- input: "TEXT\x1CC00161810\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is amending
    this report due to changes that affected summary pages from a previously amended
    report.  The Committee did a detailed de-duping of its Database and found several
    instances where donors that had contributed online used different addresses than
    when they contributed by check causing duplicate records in the database.  Upon
    combining these duplicates there were instances where the combined total of the
    individuals contributions became itemized hence the adjustments in the Detailed
    Summary Page totals on Line 11(a)(i) and 11(a)(ii) for columns A and B.  -  Please
    note that employees of the Committee that spent less than 25% of their time on
    Federal Election Activity were paid on the either Schedule H4 uniform split or
    Schedule B supporting line 21b; this includes benefits. - All fundraising activity
    was for the purpose of fundraising for the benefit of the Committee and was not
    attributable to any candidate for federal office.  - The transfer of the joint
    fundraising proceeds received during this reporting period from the New Mexico
    Senate Victory Fund, ASDC Dollars Democrats and/or the DNC Victory Fund Joint
    Fundraiser programs represents the committee's share of proceeds for contributions
    received during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the committee. - No federal transfers
    were designated for exempt activity.\n"
